@-moz-document domain("roblox.com") {
/*/ Pulsing Animation /*/
  @keyframes header-white {
    0% {
      border-color: red;
      border-width: 2px;
      background-color: red;
    } 25% {
      background-color: black;
      border-color: rgba(0, 0, 0, 0);
			border-width: 1px;
    } 75% {
      background-color: black;
      border-color: rgba(0, 0, 0, 0);
			border-width: 1px;
    } 100% {
      background-color: red;
      border-color: red;
			border-width: 2px;
    }
  }
  
  /*/ Animation Settings /*/
	#header {
    animation: header-white 5s infinite;
  }
}
